import React from "react";
import './ItemList.css';
export default class ItemList extends React.Component {
  render() {
    return (
      <div >
        <ul className="list-group list-group-flush">
          <li className="list-group-item">luke</li>
          <li className="list-group-item">leia</li>
        </ul>
      </div>
    );
  }
}
